import React from "react";
import { AppointmentTile } from "../tile/AppointmentTile";


const AppointmentTileList = ({ appointments }) => {
  return (
    <div>
      {appointments.map((app, index) => {
        const { name, ...appointmentDetails } = tile;
        return <AppointmentTile key={index} name={name} appointmentDetails={appointmentDetails} />;
      })}
    </div>
  );
};

export default AppointmentTileList;
